import React, { useState } from 'react';

const Department = ()=>{
    const [AllDepartments,setDepartments] = useState([]);
    const GetDepartments= async()=>{
        try {
            const query = await fetch('http://localhost:5000/departments');
            const data = await query.json();
            setDepartments(data);
        } catch (error) {
            console.log(error);
        }
    };
    useEffect(()=>{
        GetDepartments();
    },[]);

    return (
<div>
<table class="mt-5 table table-bordered table-dark container">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Department Name</th>
      <th scope="col">Location</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td colspan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
</div>
    );
};

export default Department;
